import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getTabPanelUtilityClass(slot) {
  return generateUtilityClass('JoyTabPanel', slot);
}
const tabListClasses = generateUtilityClasses('JoyTabPanel', ['root', 'hidden', 'sizeSm', 'sizeMd', 'sizeLg']);
export default tabListClasses;
